import React, { useState } from 'react';
import {MainPage} from './components/mainPage';
import bottomTab from './style/bottomTab'
import { View, ScrollView,Text,Button,TouchableOpacity} from 'react-native';
import FontAwesomeIcon from 'react-native-vector-icons/FontAwesome';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';



function HomeScreen() {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>Home!</Text>
    </View>
  );
}

function SettingsScreen() {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>Settings!</Text>
    </View>
  );
}

const Tab = createBottomTabNavigator();

export default function App() {
  return (
    <View>
    <NavigationContainer>
      <Tab.Navigator>
        <Tab.Screen 
        name="MainPage" component={MainPage} options={{
          tabBarIcon: ({ color, size }) => (
            <IconFontAwesomeIcon name="fa-solid fa-book" color={color} size={size} />
          ),
        }}/>
        <Tab.Screen name="Settings" component={SettingsScreen} />
      </Tab.Navigator>
    </NavigationContainer>
    </View>
  );
}
